import React, {
  useContext,
  useState,
  useEffect,
  useCallback,
  useReducer,
} from "react";
import { currntTime as time, currntDate as date } from "../hooks/useDateTime";
import { useContacts } from "./ContactsProvider";
import { useSocket } from "./SocketProvider";
// import useUpdateEffect from '../hooks/useUpdateEffect';
// import useReducersWithLocalStorage from '../hooks/useReducersWithLocalStorage';

type ConversationsContextProviderProps = {
  children: React.ReactNode;
};
export type formattedMessage = {
  senderName: string;
  fromMe: boolean;
  sender: string;
  text: string;
  date: string;
  time: string;
  type: MessageStatusType;
};
type formattedRecipient = { name: string; id: string };
export type formattedConversationType = {
  creator_id: string;
  group_id: string;
  name: string;
  recipients: formattedRecipient[];
  recipients_ids: string[];
  selected: boolean;
  messages: formattedMessage[];
  unReadMessagesCount: number;
  status: ConversationStatusType;
  image: string;
};
//Function Types
type sendMessageTypeSignatureFnType = (
  recipients: string[],
  text: string,
  group_id: string,
  creator_id: string,
  name: string
) => void;
type sendActionMessageTypeSignatureFnType = (
  recipients: string[],
  text: string,
  departures: string[],
  guests: string[],
  group_id: string,
  creator_id: string,
  name: string
) => void;
type editConversationCallbackFnType = (obj: {
  name: string;
  recipients: string[];
  creator_id: string;
  group_id: string;
  image: string;
}) => void;
type editConversationFnType = (
  name: string,
  recipients: string[],
  creator_id: string,
  group_id: string,
  image: string
) => void;
type createConversationFnType = (
  group_id: string,
  name: string,
  recipients: string[]
) => void;

type joinOrLeaveConversationFnType = (
  recipients: string[],
  group_id: string,
  type: ActionEnum
) => void;
//value Provided By Context
type ConversationsContextValueType = {
  id: string;
  conversations: formattedConversationType[];
  indexOfCurrentConversation: string | null;
  selectedConversation: {} | formattedConversationType | undefined; //here
  setUnreadMessagesCount: (group_id: string) => void;
  setKeyOfSelectedConversation: React.Dispatch<
    React.SetStateAction<string | null>
  >;
  createConversation: createConversationFnType;
  sendMessage: sendMessageTypeSignatureFnType;
  sendActionMessage: sendActionMessageTypeSignatureFnType;
  deleteConversation: (group_id: string) => void;
  editConversation: editConversationFnType;
  joinOrLeaveConversation: joinOrLeaveConversationFnType;
};

let ConversationsContext = React.createContext(
  {} as ConversationsContextValueType
);
const STATUS = { active: "active", out: "out" };
const MESSAGE_TYPE = { normal: "normal-message", action: "action-message" };
const ADD_CONVERSATION = "add-conversation";
const EDIT_CONVERSATION = "edit-conversation";
const DELETE_CONVERSATION = "remove-conversation";
const REASSIGN_MEMBERS_IN_CONVERSATION = "reassign-members-in-conversation";
const REMOVE_MEMBER = "remove-member";
const ADD_MEMBER = "add-member";
const READ_MESSAGES_CONVERSATION = "read-messages-conversation";
const ADD_MESSAGE_TO_CONVERSATION = "add-message-to-conversation";

export function useConversations() {
  return useContext(ConversationsContext);
}

type ActionType =
  | typeof ADD_CONVERSATION
  | typeof EDIT_CONVERSATION
  | typeof DELETE_CONVERSATION
  | typeof REASSIGN_MEMBERS_IN_CONVERSATION
  | typeof REMOVE_MEMBER
  | typeof ADD_MEMBER
  | typeof READ_MESSAGES_CONVERSATION
  | typeof ADD_MESSAGE_TO_CONVERSATION;

type ConversationStatusType = "active" | "out";

export type MessageStatusType = "normal-message" | "action-message";
export enum ActionEnum {
  JOIN = "JOIN",
  LEAVE = "LEAVE",
}
export type MessageType = {
  sender: string;
  text: string;
  date: string;
  time: string;
  type: MessageStatusType;
};

type DispatchActionType = {
  type: ActionType;
  payload: {
    group_id: string;
    creator_id?: string;
    name?: string;
    recipients?: string[];
    unReadMessagesCount?: number;
    status?: ConversationStatusType;
    newMessage?: MessageType;
    isConversationOpen?: boolean;
    image?: string;
  };
};

type StateStructureType = {
  [key: string]: {
    group_id: string;
    creator_id: string;
    name: string;
    conversation: {
      recipients: string[];
      messages: MessageType[];
    };
    unReadMessagesCount: number;
    status: ConversationStatusType;
    image: string;
  };
};
const initialValue: StateStructureType = JSON.parse(
  localStorage.getItem("localStorageconversationsInfo") || "{}"
);

function conversationsReducer(
  state: StateStructureType,
  action: DispatchActionType
): StateStructureType {
  var obj1: StateStructureType = state;

  function storeConversation(obj: StateStructureType) {
    localStorage.setItem("localStorageconversationsInfo", JSON.stringify(obj));
  }
  switch (action.type) {
    case ADD_CONVERSATION:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          creator_id: action.payload.creator_id,
          name: action.payload.name,
          group_id: action.payload.group_id,
          conversation: {
            recipients: action.payload.recipients,
            messages: [],
          },
          unReadMessagesCount: 0,
          status: STATUS.active as ConversationStatusType,
          image: action.payload.image,
        },
      } as StateStructureType;
      storeConversation(obj1);
      return obj1;
    case EDIT_CONVERSATION:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          name: action.payload.name,
          conversation: {
            ...state[action.payload.group_id].conversation,
            recipients: action.payload.recipients,
          },
          image: action.payload.image,
        }, //,gg:"sdf"
      } as StateStructureType;
      storeConversation(obj1);
      return obj1;
    case DELETE_CONVERSATION:
      const updatedObject = { ...state };
      delete updatedObject[action.payload.group_id];
      obj1 = updatedObject;
      storeConversation(obj1);
      return obj1;
    case ADD_MEMBER:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          status: STATUS.active as ConversationStatusType,
        },
      };
      storeConversation(obj1);
      return obj1;
    case REASSIGN_MEMBERS_IN_CONVERSATION:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          conversation: {
            ...state[action.payload.group_id].conversation,
            recipients: action.payload.recipients,
          },
        },
      } as StateStructureType;
      storeConversation(obj1);
      return obj1;
    case REMOVE_MEMBER:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          status: STATUS.out as ConversationStatusType,
        },
      };
      storeConversation(obj1);
      return obj1;
    case READ_MESSAGES_CONVERSATION:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          unReadMessagesCount: 0,
        },
      };
      storeConversation(obj1);
      return obj1;
    case ADD_MESSAGE_TO_CONVERSATION:
      obj1 = {
        ...state,
        [action.payload.group_id]: {
          ...state[action.payload.group_id],
          conversation: {
            ...state[action.payload.group_id].conversation,
            messages: [
              ...state[action.payload.group_id].conversation.messages,
              action.payload.newMessage,
            ],
          },
          unReadMessagesCount: action.payload.isConversationOpen
            ? 0
            : state[action.payload.group_id].unReadMessagesCount + 1,
        },
      } as StateStructureType;
      storeConversation(obj1);
      return obj1;
    default:
      return state;
  }
}

export function ConversationsProvider({
  children,
}: ConversationsContextProviderProps) {
  console.log("Conversation Provider");
  let { contacts } = useContacts(); //why when i make it [] all contact hidden !!!
  let { socket, id } = useSocket();
  let [conversations, dispatchConversations] = useReducer(
    conversationsReducer,
    initialValue
  );
  const [keyOfSelectedConversation, setKeyOfSelectedConversation] = useState<
    string | null
  >(null);
  const [boolDeleteConversation, setBoolDeleteConversation] = useState(false);

  if (boolDeleteConversation) {
    //enter to this code after deleting the conversation
    setKeyOfSelectedConversation(null); //solve the problem to set the index of current conversation to -1 after delete the conversation
    setBoolDeleteConversation(false);
  }

  const setUnreadMessagesCount = useCallback(
    (group_id: string) => {
      dispatchConversations({
        type: READ_MESSAGES_CONVERSATION,
        payload: { group_id },
      });
    },
    [dispatchConversations]
  );

  type addMessageToConversationType = {
    text: string;
    sender: string;
    group_id: string;
    type?: MessageStatusType;
    recipients?: string[];
    creator_id?: string;
    name?: string;
  };
  const addMessageToConversation = useCallback(
    ({
      text,
      sender,
      group_id,
      type = MESSAGE_TYPE.normal as MessageStatusType,
      recipients,
      creator_id,
      name,
    }: addMessageToConversationType) => {
      const newMessage = { sender, text, date: date(), time: time(), type };
      //if(sender !== id) setAlertsShown(prev=>[...prev, {...newMessage}]);
      const isConversationOpen = keyOfSelectedConversation === group_id;
      if (!conversations[group_id]) {
        dispatchConversations({
          type: ADD_CONVERSATION,
          payload: { group_id, creator_id, name, recipients },
        });
      }
      dispatchConversations({
        type: ADD_MESSAGE_TO_CONVERSATION,
        payload: { group_id, newMessage, isConversationOpen },
      });
    },
    [keyOfSelectedConversation, dispatchConversations, conversations]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on("receive-message", addMessageToConversation);
    return () => {
      socket?.off("receive-message");
    };
  }, [socket, addMessageToConversation]);

  const addMemberCallback = useCallback(
    (group_id: string) => {
      dispatchConversations({ type: ADD_MEMBER, payload: { group_id } });
    },
    [dispatchConversations]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on("add-member", addMemberCallback);
    return () => {
      socket?.off("add-member");
    };
  }, [socket, addMemberCallback]);

  const removeMemberCallback = useCallback(
    (group_id: string) => {
      dispatchConversations({ type: REMOVE_MEMBER, payload: { group_id } });
    },
    [dispatchConversations]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on("remove-member", removeMemberCallback);
    return () => {
      socket?.off("remove-member");
    };
  }, [socket, removeMemberCallback]);

  const addConversation = useCallback(
    ({
      group_id,
      creator_id,
      name,
      recipients,
      image,
    }: {
      group_id: string;
      creator_id: string;
      name: string;
      recipients: string[];
      image: string;
    }) => {
      dispatchConversations({
        type: ADD_CONVERSATION,
        payload: { group_id, creator_id, name, recipients, image },
      });
      setKeyOfSelectedConversation(group_id);
    },
    [setKeyOfSelectedConversation, dispatchConversations]
  );
  const defaultImg: string =
    "data:image/png;base64,";

  const createConversation: createConversationFnType = useCallback(
    (group_id, name, recipients) => {
      socket?.emit("add-conversation", {
        group_id,
        name,
        recipients,
        image: defaultImg,
      });
    },
    [socket]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on("add-conversation", addConversation);
    return () => {
      socket?.off("add-conversation");
    };
  }, [socket, addConversation]);

  const editConversationCallback: editConversationCallbackFnType = useCallback(
    ({ name, recipients, creator_id, group_id, image }) => {
      if (conversations[group_id]) {
        //the aim of this check is to edit both the name and members of this conversation for all users that already have membership on this conversation or have this conversation on side of them
        console.log("AAAAAAAAAAAAAAAA", conversations[group_id]);
        dispatchConversations({
          type: EDIT_CONVERSATION,
          payload: { name, recipients, group_id, image },
        });
      } else {
        console.log("BBBBBBBBBBBBBBBB", conversations[group_id]);
        dispatchConversations({
          type: ADD_CONVERSATION,
          payload: { group_id, creator_id, name, recipients, image },
        });
      }
    },
    [dispatchConversations, conversations, id]
  );

  const editConversation: editConversationFnType = useCallback(
    (name, recipients, creator_id, group_id, image) => {
      socket?.emit("edit-conversation", {
        name,
        recipients,
        creator_id,
        group_id,
        image,
      });
    },
    [socket]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on("receive-edit-conversation", editConversationCallback);
    return () => {
      socket?.off("receive-edit-conversation");
    };
  }, [socket, editConversationCallback]);

  const receiveJoinOrLeaveConversation = useCallback(
    ({ recipients, group_id }: { recipients: string[]; group_id: string }) => {
      dispatchConversations({
        type: REASSIGN_MEMBERS_IN_CONVERSATION,
        payload: { recipients, group_id },
      });
    },
    [dispatchConversations]
  );
  const joinOrLeaveConversation: joinOrLeaveConversationFnType = useCallback(
    (recipients, group_id, type) => {
      socket?.emit("join-or-leave-conversation", {
        recipients,
        group_id,
        type,
      });
    },
    [socket]
  );

  useEffect(() => {
    if (socket == null) return;
    socket.on(
      "receive-join-or-leave-conversation",
      receiveJoinOrLeaveConversation
    );
    return () => {
      socket?.off("receive-join-or-leave-conversation");
    };
  }, [socket, receiveJoinOrLeaveConversation]);

  const deleteConversation = useCallback(
    (group_id: string) => {
      dispatchConversations({
        type: DELETE_CONVERSATION,
        payload: { group_id },
      });
      setBoolDeleteConversation(true);
    },
    [dispatchConversations]
  );

  const sendMessage: sendMessageTypeSignatureFnType = useCallback(
    (recipients, text, group_id, creator_id, name) => {
      socket?.emit("send-message", {
        recipients,
        text,
        group_id,
        creator_id,
        name,
      });
      // (creator_id, name) are additional props to make others re-create their conversation when they receive a new message and the conversation is being deleted
      addMessageToConversation({ text, sender: id, group_id });
    },
    [socket, addMessageToConversation, id]
  );
  const sendActionMessage: sendActionMessageTypeSignatureFnType = useCallback(
    (recipients, text, departures, guests, group_id, creator_id, name) => {
      socket?.emit("send-action-message", {
        recipients,
        text,
        departures,
        guests,
        group_id,
        creator_id,
        name,
      }); // (creator_id, name) are additional props to make others re-create their conversation when they receive a new message and the conversation is being deleted
      addMessageToConversation({
        text: `You have just added ${text}`,
        sender: id,
        group_id,
        type: "action" as MessageStatusType,
      });
    },
    [socket, addMessageToConversation, id]
  );
  const formattedConversations: formattedConversationType[] = Object.values(
    conversations
  ).map((conversationInfo) => {
    const idOfCreator = conversationInfo.creator_id;
    const idOfConversation = conversationInfo.group_id;
    const nameOfConversation = conversationInfo.name;
    const recipients = conversationInfo.conversation.recipients.map(
      (recipient_id) => {
        const contact = contacts.find((contact) => contact.id === recipient_id);
        const name = (contact && contact.name) || recipient_id;
        return { id: recipient_id, name };
      }
    );
    const recipients_ids = conversationInfo.conversation.recipients;
    const selected = conversationInfo.group_id === keyOfSelectedConversation;
    const messages = conversationInfo.conversation.messages.map((message) => {
      const contact = contacts.find((contact) => contact.id === message.sender);
      const name = (contact && contact.name) || message.sender;
      const fromMe = id === message.sender;
      return { ...message, senderName: name, fromMe };
    });

    const unReadMessagesCount = conversationInfo.unReadMessagesCount;
    const status = conversationInfo.status;
    const image = conversationInfo.image;
    const result: formattedConversationType = {
      creator_id: idOfCreator,
      group_id: idOfConversation,
      name: nameOfConversation,
      recipients,
      recipients_ids,
      selected,
      messages,
      unReadMessagesCount,
      status,
      image,
    };
    return result;
  });

  type getFormattedConversationType = (
    key: string | null
  ) => formattedConversationType | {} | undefined;
  const getFormattedConversation: getFormattedConversationType = useCallback(
    (key) => {
      if (!key) return {};
      for (const conv_obj of formattedConversations) {
        if (conv_obj["group_id"] === key) {
          return conv_obj;
        }
      }
    },
    [formattedConversations]
  );

  const value: ConversationsContextValueType = {
    id,
    conversations: formattedConversations,
    indexOfCurrentConversation: keyOfSelectedConversation,
    selectedConversation: getFormattedConversation(keyOfSelectedConversation), //here
    setUnreadMessagesCount,
    setKeyOfSelectedConversation,
    createConversation,
    sendMessage,
    sendActionMessage,
    deleteConversation,
    editConversation,
    joinOrLeaveConversation,
  };
  return (
    <ConversationsContext.Provider value={value}>
      {children}
    </ConversationsContext.Provider>
  );
}

